import { Link } from 'react-router-dom'

import Container from './Container'

import styles from './Nav'

function Navbar(){
    return(
        <>
            <Link to='/'>Home</Link>
            <Link to='/Contato'>Contato</Link>
            <Link to='/Sobre'>Sobre</Link>
        </> 
        

    )
}

export default Navbar
